message:
Veja como é a semana de um Católico, Devoção de cada dia da semana: 
Domingo - Dia do Senhor, Dedicado à Ressurreição de Cristo e à Santíssima Trindade;
Segunda - Dedicado as almas do purgatório;
Terça - Santos Anjos;
Quarta - São José;
Quinta - Santíssimo Sacramento;
Sexta - A Paixão de Cristo e ao Sagrado Coração de Jesus;
Sábado - À Nossa Senhora e ao Imaculado Coração de Maria.

Comandante do Pelotão de Investigações Criminais (PIC) dos Batalhões de Polícia do Exército (BPE), capacitando-os a:
    - assessorar os Comandantes de BPE na elucidação de ilícitos no âmbito do Comando Militar de Área;   
    - elucidar, crimes envolvendo militares em atividades de guerra e de não-guerra;
    - produzir provas técnicas para a Justiça Militar; e
   - assessorar, como investigador criminal, os encarregados de Inquérito Policial Militar, quando solicitado.
REQUISITOS
   - ser tenente de carreira da Arma de Infantaria;
   - preencher o requerimento eletrônico conforme calendário DECEx; e
   - estar em boas condições físicas e de saúde;

